import React, { useState } from 'react';
import axios from 'axios';

function PostForm(){
    const url= ""; //Get Url from Arjun and add it here
    const [data, setData] = useState({
        target: "",
        videoUrl: ""
    })

    function submit(e){
        e.preventDefault();
        axios.post(url, {
            target: data.target,
            videoUrl: data.videoUrl
        }).then(res=>{
            console.log(res.data)
        })
    }

    function handle(e){
        const newdata={...data}
        newdata[e.target.id] = e.target.value
        setData(newdata)
        console.log(newdata)
    }

    return (
        <form onSubmit={(e)=> submit(e)}>
            <input onChange={(e) => handle(e)} id="target" value={data.target} placeholder="Target Audience" type="number"></input>
            <input onChange={(e) => handle(e)} id="videoUrl" value={data.videoUrl} placeholder="Video Url" type="text"></input>
            <button>Submit</button>
        </form>
    );
}

export default PostForm;
